window.bookSummaryJSON = "<p>From number one best-selling author Brandon Sanderson and Janci Patterson comes the final of three Skyward series novellas, each told from the perspective of a different member of the team back on Detritus. Listen to Jorgen's story along with <i>Cytonic</i>.</p> <p>With the government of Detritus in disarray because of Superiority treachery, and with Spensa still away on her mission in the Nowhere, Jorgen must work together with the alien Alanik to pick up the pieces. They intercept a strange transmission from the planet Evershore and its Kitsen inhabitants, who say they have some of Jorgenâ€™s people and want to return them - but can the Kitsen be trusted? And can Jorgen learn to master his increasingly erratic cytonic powers before they spiral out of control and destroy all hope of forming an alliance against the Superiority?</p> <p>Praise for <i>Skyward</i></p> <p>An Instant <i>New York Times</i> Best Seller</p> <p>A <i>Kirkus Reviews</i> Best Book of the Year</p>"; 
